export default function PageNotFound() {
  return (
    <div className="page-not-found">
      <h2>404 Page not found</h2>
      <p>
        Sorry, the page you are looking for has not been found. <i class="fa-solid fa-face-frown"></i>
      </p>
    </div>
  )
}
